import React, { Component } from 'react';
import { Layout, Navigation, Content } from 'react-mdl';
import { Link} from 'react-router-dom';

import BetsFriends from './images/BetsFriends.png';

class Project extends Component {
  render() {

    return (
      <div className="MainFormat">
        <div className="Header">
          <Link to="/"><p>back</p></Link>
        </div>
        <div className="GridMain">
          <div>
            <p>hola</p>
          </div>
          <div className="GridProjects">
            <div>
              <Link to="/"><img className="ProjectPic" src={BetsFriends}/></Link>
            </div>
            <div>
            <Link to="/project"><img className="ProjectPic" src={BetsFriends}/></Link>
            </div>
            <div>
            <Link to="/project"><img className="ProjectPic" src={BetsFriends}/></Link>
            </div>
          </div>
          <div>
            <p>hola</p>
          </div>
        </div>
      </div>
    );
  }
  }
export default Project;
